import React, { useState, useEffect } from 'react';
import axios from "axios";
import './my_proposal.css';
import { useNavigate } from 'react-router-dom';

const MyProposal = (props) => {
    const navigate = useNavigate();

    const handleLogout = () => {
      navigate('/');
    };
    const handleHome = () => {
      navigate('/home');
    };
    const handleSearchResume = () => {
      navigate('/searchResume');
    };
    const handleSearchNotice = () => {
      navigate('/searchNotice');
    };
    const handleSelectResume = () => {
      navigate('/selectedResume');
    };
    const handleResumeResult = () => {
      navigate('/resumeResult');
    };
  return (
    <div className="my-proposal-container">
      <span className="my-proposal-text">Teaming</span>
      <span className="my-proposal-text01">효율적인 팀 매칭 서비스</span>
      <footer className="my-proposal-footer">
        <span className="my-proposal-text02">
          © 2023 Teaming, All Rights Reserved.
        </span>
      </footer>
      <h1 className="my-proposal-text03">
        <span>나에게 온 제안</span>
        <br></br>
      </h1>
      <ul className="list"></ul>
      <form className="my-proposal-form"></form>
      <button type="button" className="my-proposal-button button">
        <span className="my-proposal-text06">
          <span>홈</span>
          <br></br>
        </span>
      </button>
      <button type="button" className="my-proposal-button1 button">
        <span>
          <span>Logout</span>
          <br></br>
        </span>
      </button>
      <button type="button" className="my-proposal-button2 button">
        <span className="my-proposal-text12">
          <span>이력서 검색</span>
          <br></br>
        </span>
      </button>
      <button type="button" className="my-proposal-button3 button">
        모집 공고 검색
      </button>
      <button type="button" className="my-proposal-button4 button">
        <span className="my-proposal-text15">
          <span>내 이력서</span>
          <br></br>
        </span>
      </button>
      <button type="button" className="my-proposal-button5 button">
        <span className="my-proposal-text18">
          <span>내 모집 공고</span>
          <br></br>
        </span>
      </button>
      <form className="my-proposal-form1">
        <span className="my-proposal-text22">Role</span>
      </form>
      <form className="my-proposal-form2">
        <span className="my-proposal-text25">Role</span>
      </form>
      <form className="my-proposal-form3">
        <span className="my-proposal-text28">Role</span>
      </form>
    </div>
  )
}

export default MyProposal
